import PropTypes from 'prop-types'
import Button from './Button'

const Header = ({title}) => {
    const click = () => {
        console.log('Click')
    }
    return (
        <header className='header'>
        <h1>{title}</h1>
        <Button color= 'green' text='Add' onClick={click} />
        </header>
    )
}

Header.defaultProps = {
    title: 'Task Tracker',
}

Header.propTypes = {
    title: PropTypes.string.isRequired,
}

export default Header
